    const styles = useSpring({
        from: { opacity: 0 },
        to: { opacity: 1 },
        delay: 4000,
      })
  return (
    <animated.div className="test" style={styles}>
        <p>component</p>
    </animated.div>
  )
}

export default ComponentOneL;
